import React from 'react';
import Appbar from '../surface/Appbar';
import uccplogo from '../assets/uccplogo.png';
import schlogo from '../assets/schlogo.png';

function Dashboard() {
  return ( 
    <>
    <div><Appbar /></div> 
    <div className='h-screen  justify-center items-center'>
      
      <section className='grid gap-8 md:grid-cols-2'>
        <div className='flex flex-col-2'>
          <img src={schlogo} alt="" className='h-22 w-22 mx-50 my-0' />
        </div>
        <div className='justify-center px-2 flex flex-col'>
          <p className='text-xl font-bold mb-2 sm:align-middle sm:text-center md:align-middle md:text-center'>Welcome to</p>
          <h1 className='text-3xl font-bold' style={{ color: '#079440' }}>Cagayan de Oro Christian School - UCCP </h1>
          <h1 className='text-3xl font-bold' style={{ color: '#F2B569' }}>E-Portal</h1>
        </div>
      </section>
    </div>
    </>
  );
}

export default Dashboard;
